[Met-Art] - 2012-04-12 - Surime A - presenting [x117] MIDRES

Surime A

Age: 19

Eye color: green

Hair color: blonde

Height: 168cm

Weight: 48kg

Breast size: large

Measurements: 92/60/90

Country: Ukraine

Ethnicity: Caucasian


Bio: I recently finished high school and now thinking about my future career and trying to find a possibility to study at the university. Basically I like drawing and my favorite style is watercolors and pastel.  Also I like photography and I adore to make photos with old film cameras. As most young girls I like parties and nice music.  I could listen to rock and also like classic music too, depending on my mood. During winter I like skiing and visiting skating rinks. During snowy winter nights I like to read books.  

